function Cart() {
    useEffect(() => {
        const fetchCart = async () => {
            try {
                const userID = JSON.parse(localStorage.getItem("userID"));
                const response = await axios.post(`http://localhost:3001/api/getCart/${userID}`);
                console.log(response);
            } catch (error) {
                console.error("Error fetching cart data:", error);
            }
        };

        fetchCart();
    }, []);
    return (<div>
        <h1>These are the Items you have added</h1>
        <p>Tick them to remove if you like to remove</p>

    </div>);
}

export default Cart;
